#include <iostream>
#include <string.h>
#include <chrono>
#include <omp.h>

using namespace std;

int count_occurence (const char *text_string, const char *pattern)
{
  const int len_p = strlen(pattern);
  const int len_t = strlen(text_string);
  int i, matches = 0;

  for (i=0; i<=len_t-len_p; i++)
    if (strncmp(&(text_string[i]), pattern, len_p) == 0)
      matches++;

  return matches;
}

int omp_count_occurence (const char *text_string, const char *pattern)
{
  const int len_p = strlen(pattern);
  const int len_t = strlen(text_string);
  int i, matches = 0;

  omp_set_num_threads(omp_get_max_threads());

  #pragma omp parallel for reduction(+: matches)
  for (i=0; i<=len_t-len_p; i++)
    if (strncmp(&(text_string[i]), pattern, len_p) == 0)
      matches++;

  return matches;
}

int main ()
{
  std::chrono::high_resolution_clock::time_point start, stop;
  int count;

  const char *longtext =
    "";

  start = std::chrono::high_resolution_clock::now();
  count = count_occurence(longtext, "GCAGA");
  stop = std::chrono::high_resolution_clock::now();
  auto duration = std::chrono::duration_cast<std::chrono::microseconds>(stop - start);
  std::cout << "Duration of serial: "
      << duration.count() << " microseconds" << std::endl;
  cout << count << " should equal 2" << endl;
  /*
  cout << count_occurence("AAABCDEFGAAGEREAANMT", "AA")
    << " should equal 4" << endl;
  cout << count_occurence("ABCDEFGHIJKLMNOPQRSTUVWXYZ", "BTTT")
    << " should equal 0" << endl << endl;
  // */
  start = std::chrono::high_resolution_clock::now();
  count = omp_count_occurence(longtext, "GCAGA");
  stop = std::chrono::high_resolution_clock::now();
  duration = std::chrono::duration_cast<std::chrono::microseconds>(stop - start);
  std::cout << "Duration of parallel: "
      << duration.count() << " microseconds" << std::endl;
  cout << count << " should equal 2" << endl;
  /*
  cout << omp_count_occurence("AAABCDEFGAAGEREAANMT", "AA")
    << " should equal 4" << endl;
  cout << omp_count_occurence("ABCDEFGHIJKLMNOPQRSTUVWXYZ", "BTTT")
    << " should equal 0" << endl << endl;
  // */

  return 0;
}
